import React from 'react';
import { Link } from 'react-router-dom';

function SearchPokemon() {
  return (
    <div>
        <h1>pesquise seu pokemon</h1>
        <h5>Ou veja todos pokemons: </h5>

        <Link to="pokemons"></Link>
    </div>
  );
}

export default SearchPokemon;
